import React from 'react';
import Home from "./pages/Home";
import Products from './pages/Products';
import Product from './pages/Product';

import{
  createBrowserRouter,

  RouterProvider,
} from 'react-router-dom';


const router = createBrowserRouter([
  {path: '/',
  element: <Home/>,
},
  {path: '/catagory/:id',
  element: <Products />,
},
  {path: '/product/:id',
  element: <Product />,
},

]);

function App() {
  return (
    <div>
      <RouterProvider router={router} />
    </div>
  );
}

export default App;
